// src/components/ProjectManagerDashboard.js
import React, { useState, useEffect } from "react";
import { Button, Table, Modal, Form } from "react-bootstrap";
import axios from "axios";
import { toast } from "react-toastify";
import { useNavigate } from "react-router-dom";

const ProjectManagerDashboard = () => {
  const [projects, setProjects] = useState([]);
  const [tasks, setTasks] = useState([]);
  const [showProjectModal, setShowProjectModal] = useState(false); // Modal visibility for projects
  const [showTaskModal, setShowTaskModal] = useState(false); // Modal visibility for tasks
  const [editProject, setEditProject] = useState(null); // For editing projects
  const [editTask, setEditTask] = useState(null); // For editing tasks
  const [newProject, setNewProject] = useState({
    name: "",
    description: "",
  });
  const [newTask, setNewTask] = useState({
    name: "",
    description: "",
    status: "Pending", // Default status
    projectId: null,
  });
  const navigate = useNavigate();

  useEffect(() => {
    fetchProjects();
    fetchTasks();
  }, []);

  // Fetch projects from the API
  const fetchProjects = async () => {
    try {
      const response = await axios.get(
        "http://localhost:5220/api/projectmanager/get-projects"
      );
      setProjects(response.data);
    } catch (error) {
      console.error(error);
      toast.error("Error fetching projects");
    }
  };

  // Fetch tasks from the API
  const fetchTasks = async () => {
    try {
      const response = await axios.get(
        "http://localhost:5220/api/projectmanager/get-tasks"
      );
      setTasks(response.data);
    } catch (error) {
      console.error(error);
      toast.error("Error fetching tasks");
    }
  };

  // Handle Add or Edit Project
  const handleSaveProject = async () => {
    try {
      if (editProject) {
        // Update Project
        await axios.put(
          `http://localhost:5220/api/projectmanager/update-projects/${editProject.projectId}`,
          newProject
        );
        toast.success("Project updated successfully!");
      } else {
        // Add Project
        await axios.post(
          "http://localhost:5220/api/projectmanager/create-project",
          newProject
        );
        toast.success("Project added successfully!");
      }
      fetchProjects();
      handleCloseProjectModal();
    } catch (error) {
      console.error(error);
      toast.error("Error saving project");
    }
  };

  // Handle Add or Edit Task
  const handleSaveTask = async () => {
    try {
      if (editTask) {
        // Update Task
        await axios.put(
          `http://localhost:5220/api/projectmanager/update-task/${editTask.taskId}`,
          newTask
        );
        toast.success("Task updated successfully!");
      } else {
        // Add Task
        await axios.post(
          "http://localhost:5220/api/projectmanager/create-task",
          newTask
        );
        toast.success("Task added successfully!");
      }
      fetchTasks();
      handleCloseTaskModal();
    } catch (error) {
      console.error(error);
      toast.error("Error saving task");
    }
  };

  // Delete project
  const handleDeleteProject = async (id) => {
    try {
      await axios.delete(
        `http://localhost:5220/api/projectmanager/delete-project/${id}`
      );
      toast.success("Project deleted successfully!");
      fetchProjects();
    } catch (error) {
      console.error(error);
      toast.error("Error deleting project");
    }
  };

  // Delete task
  const handleDeleteTask = async (id) => {
    try {
      await axios.delete(
        `http://localhost:5220/api/projectmanager/tasks/${id}`
      );
      toast.success("Task deleted successfully!");
      fetchTasks();
    } catch (error) {
      console.error(error);
      toast.error("Error deleting task");
    }
  };

  // Open modal for editing project
  const handleEditProject = (project) => {
    setEditProject(project);
    setNewProject({
      name: project.name,
      description: project.description,
    });
    setShowProjectModal(true);
  };

  // Open modal for editing task
  const handleEditTask = (task) => {
    setEditTask(task);
    setNewTask({
      name: task.name,
      description: task.description,
      status: task.status,
      projectId: task.projectId,
    });
    setShowTaskModal(true);
  };

  // Handle close modal for projects
  const handleCloseProjectModal = () => {
    setEditProject(null);
    setNewProject({
      name: "",
      description: "",
    });
    setShowProjectModal(false);
  };

  // Handle close modal for tasks
  const handleCloseTaskModal = () => {
    setEditTask(null);
    setNewTask({
      name: "",
      description: "",
      status: "Pending",
      projectId: null,
    });
    setShowTaskModal(false);
  };

  // Logout function
  const handleLogout = () => {
    navigate("/"); // Redirect to login page
    toast.success("Logged out successfully");
  };

  return (
    <div className="container mt-5">
      <h2>Project Manager Dashboard</h2>
      <Button variant="danger" className="mb-3" onClick={handleLogout}>
        Logout
      </Button>

      {/* Add Project */}
      <Button
        variant="primary"
        className="mb-3"
        onClick={() => setShowProjectModal(true)}
      >
        Add New Project
      </Button>

      {/* Project Table */}
      <h3>Projects</h3>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>#</th>
            <th>Project Name</th>
            <th>Description</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {projects.map((project, index) => (
            <tr key={project.projectId}>
              <td>{index + 1}</td>
              <td>{project.name}</td>
              <td>{project.description}</td>
              <td>
                <Button
                  variant="warning"
                  className="me-2"
                  onClick={() => handleEditProject(project)}
                >
                  Edit
                </Button>
                <Button
                  variant="danger"
                  onClick={() => handleDeleteProject(project.projectId)}
                >
                  Delete
                </Button>
              </td>
            </tr>
          ))}
        </tbody>
      </Table>

      {/* Task Table */}
      <h3>Tasks</h3>
      <Button
        variant="primary"
        className="mb-3"
        onClick={() => setShowTaskModal(true)}
      >
        Add New Task
      </Button>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>#</th>
            <th>Task Name</th>
            <th>Description</th>
            <th>Status</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {tasks.map((task, index) => (
            <tr key={task.taskId}>
              <td>{index + 1}</td>
              <td>{task.name}</td>
              <td>{task.description}</td>
              <td>{task.status}</td>
              <td>
                <Button
                  variant="warning"
                  className="me-2"
                  onClick={() => handleEditTask(task)}
                >
                  Edit
                </Button>
                <Button
                  variant="danger"
                  onClick={() => handleDeleteTask(task.taskId)}
                >
                  Delete
                </Button>
              </td>
            </tr>
          ))}
        </tbody>
      </Table>

      {/* Add/Edit Project Modal */}
      <Modal show={showProjectModal} onHide={handleCloseProjectModal}>
        <Modal.Header closeButton>
          <Modal.Title>
            {editProject ? "Edit Project" : "Add Project"}
          </Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form>
            <Form.Group>
              <Form.Label>Project Name</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter project name"
                value={newProject.name}
                onChange={(e) =>
                  setNewProject({ ...newProject, name: e.target.value })
                }
              />
            </Form.Group>

            <Form.Group>
              <Form.Label>Description</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter project description"
                value={newProject.description}
                onChange={(e) =>
                  setNewProject({ ...newProject, description: e.target.value })
                }
              />
            </Form.Group>
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleCloseProjectModal}>
            Close
          </Button>
          <Button variant="primary" onClick={handleSaveProject}>
            Save
          </Button>
        </Modal.Footer>
      </Modal>

      {/* Add/Edit Task Modal */}
      <Modal show={showTaskModal} onHide={handleCloseTaskModal}>
        <Modal.Header closeButton>
          <Modal.Title>{editTask ? "Edit Task" : "Add Task"}</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form>
            <Form.Group>
              <Form.Label>Task Name</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter task name"
                value={newTask.name}
                onChange={(e) =>
                  setNewTask({ ...newTask, name: e.target.value })
                }
              />
            </Form.Group>

            <Form.Group>
              <Form.Label>Description</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter task description"
                value={newTask.description}
                onChange={(e) =>
                  setNewTask({ ...newTask, description: e.target.value })
                }
              />
            </Form.Group>

            <Form.Group>
              <Form.Label>Status</Form.Label>
              <Form.Control
                as="select"
                value={newTask.status}
                onChange={(e) =>
                  setNewTask({ ...newTask, status: e.target.value })
                }
              >
                <option>Pending</option>
                <option>In Progress</option>
                <option>Completed</option>
              </Form.Control>
            </Form.Group>

            <Form.Group>
              <Form.Label>Project</Form.Label>
              <Form.Control
                as="select"
                value={newTask.projectId}
                onChange={(e) =>
                  setNewTask({ ...newTask, projectId: e.target.value })
                }
              >
                <option value="">Select Project</option>
                {projects.map((project) => (
                  <option key={project.projectId} value={project.projectId}>
                    {project.name}
                  </option>
                ))}
              </Form.Control>
            </Form.Group>
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleCloseTaskModal}>
            Close
          </Button>
          <Button variant="primary" onClick={handleSaveTask}>
            Save
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
};

export default ProjectManagerDashboard;
